import { Component } from '@angular/core';
import { GetqouteService } from 'src/app/services/getqoute.service';

@Component({
  selector: 'app-policies',
  templateUrl: './policies.component.html',
  styleUrls: ['./policies.component.scss']
})
export class PoliciesComponent {
  combinedDetailsList:any;

  constructor(
    private combinedDetailService:GetqouteService,

  ){}
  ngOnInit(): void {
    this.fetchCombinedDetail();
  }

  fetchCombinedDetail(): void {
      this.combinedDetailService.getCombinedDetail().subscribe((Response) => {
        if (Response.status == 201 || Response.status==200) {
          this.combinedDetailsList=Response["body"];

        }
      });
    }

}
<!-- Combined Table -->
<h2>Profiles</h2>

<table>
  <thead>
    <tr>
      <th>CNIC</th>
      <th>Name</th>
      <th>Email</th>
      <th>License Number</th>
      <th>Expiry Date</th>
      <th>Date of Birth</th>
      <th>Registeration Number</th>
      <th>Color</th>
      <th>Model</th>
      <th>Year</th>
    </tr>
  </thead>
  <tbody>
    <tr *ngFor="let combinedDetails of combinedDetailsList">
      <td>{{ combinedDetails.cnic }}</td>
      <td>{{ combinedDetails.name }}</td>
      <td>{{ combinedDetails.email }}</td>
      <td>{{ combinedDetails.licenseNumber }}</td>
      <td>{{ combinedDetails.expiryDate }}</td>
      <td>{{ combinedDetails.dob }}</td>
      <td>{{ combinedDetails.registerationNumber }}</td>
      <td>{{ combinedDetails.color }}</td>
      <td>{{ combinedDetails.model }}</td>
      <td>{{ combinedDetails.year }}</td>
    </tr>
  </tbody>
</table>
